import React from 'react';

export default function Footer(props) {
    const githubIcon = <img 
        src={require('../assets/github-brands.svg')} 
        alt='Down arrow' 
        width='50px' />;

    const linkedInIcon = <img 
        src={require('../assets/linkedin-brands.svg')} 
        alt='Down arrow' 
        width='50px' />;

    const contactIcon = <img 
        src={require('../assets/envelope-open-text-solid.svg')} 
        alt='Down arrow' 
        width='50px' />;

    return (
        <div className='fixed-bottom bg-dark d-flex justify-content-center'>
            {githubIcon}
            {linkedInIcon}
            {contactIcon}
        </div>
    )
}
